import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResult = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div style={{ backgroundColor: "#f0f0f0", padding: "20px" }}>
            <h1 style={{ color: "blue", fontSize: "32px", marginBottom: "10px" }}>
                {mydata.searchname}
            </h1>
            <img
                src={mydata.thumbnail}
                alt={mydata.searchname}
                style={{ maxWidth: "100%" }}
            />
            <p style={{ lineHeight: "1.5" }}>{mydata.abstract}</p>
            <h2 style={{ color: "green", fontSize: "24px", marginTop: "20px" }}>
                Books:
            </h2>
            <ul>
                {mydata.book.map((book) => (
                    <li key={book} style={{ color: "gray", fontSize: "18px" }}>
                        {book}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default SearchResult;
